import React from "react"
import ReactDOM from "react-dom/client"
import "./style.css"

const root= ReactDOM.createRoot(document.getElementById("root"))

//creating navbar component
function Navbar(){
    return(
        <nav>
            <h1>Perfumy</h1>
            <ul>
                <li>Home |</li>
                <li>Product |</li>
                <li>Contact |</li>
                <li>About us |</li>
            </ul>
        </nav>
    )
}
//search componet
function Search(){
    return(
        <div className="searchbar">
            <input placeholder="Search"></input>
        </div>
    )
}
//product component

root.render(
    <div>
        <Navbar></Navbar>
        <Search></Search>
    </div>
)
